import React from 'react'
import data from '../data'

export default function ProductScreen() {
    const product=data.products.find(x=>x._id)
    return (
        <div>
           <div className="row">
               <div className="col-2">
                   <img src={product.image} alt={product.name}></img>
               </div>
               <div className="col-1"></div>
               <div className="col-1"></div>
           </div>
        </div>
    )
}
